import React, { Component } from 'react';
import './topbar.css';

import titleximg from '../assets/i-large.png';

class topbar extends Component {
  render() {
    return (
      <div className="topbar">

        <div class="top-bar">
           <div class="brand">
             <img src={titleximg} width="157" />
           </div>
           Companies, Angels, Sharktank
        </div>

      </div>
    );
  }
}

export default topbar;
